// SPDX-License-Identifier: MIT
pragma solidity 0.8.30;  // 0.8.20 이상 0.9.0 미만 컴파일러 허용

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract TokenA is ERC20 {
    constructor() ERC20("TokenA", "A") {
        _mint(msg.sender, 50 * 10);
    }
}
contract Exchange is ERC20{
    address public tokenAddress;

    constructor() ERC20("Uniswap LP", "UNI-LP"){
        tokenAddress = tokenAddress;
    }

    function addLiquidity() public payable {
        uint etherAmount = msg.value;
        uint tokenAmount = etherAmount;

        TokenA tokenContract = TokenA(tokenAddress);
        tokenContract.transferFrom(msg.sender, address(this), tokenAmount);
        // TrasnferFrom : 내 토큰을 빼서 해당 컨트랙트에 전송한다.
        // 나의 토큰 빼기 balances[msg.sender] -= tokenAmount
        // 나의 토큰 CA에 넣기 (유동성 제공) balances[Exchange CA) += tokenAmount;
        _mint(msg.sender, etherAmount);
        // LP 토큰 발행
    }

    function removeLiquidity(uint lpTokenAmount) public {

        _burn(msg.sender, lpTokenAmount);

        // 총 Ether 갯수 * 지분율
        uint etherAmount = address(this).balance * lpTokenAmount / balanceOf(address(this));

        // 총 Token 갯수 * 지분율
        ERC20 token = ERC20(tokenAddress);
        uint tokenAmount = token.balanceOf(address(this)) * lpTokenAmount / balanceOf(address(this));

        payable(msg.sender).transfer(etherAmount);
        token.transfer(msg.sender, tokenAmount);
    }

    function getInputPrice(uint inputAmount, uint inputReserve, uint outputReserve) public pure returns(uint outputAmount) {
        return inputAmount * 997 / 1000;
    }

    function getOutputPrice(uint outputAmount, uint inputReserve, uint outputReserve) public pure returns(uint inputAmount){
        return outputAmount / 997 * 1000;
    }

    // ETH만큼 토큰으로 바꿔주는 것
    function etherToTokenInput(uint minTokens) public payable {
        uint etherAmount = msg.value;
        ERC20 token = ERC20(tokenAddress);

        uint etherReserve = address(this).balance;
        uint tokenReserve = token.balanceOf(address(this))-msg.value;
        uint tokenAmount = getInputPrice(etherAmount, etherReserve, tokenReserve);

        require(tokenAmount >= minTokens); // MEV Attack 방지 

        token.transfer(msg.sender, tokenAmount); 
    }

    // 원하는 갯수의 토큰으로 바꿔주는 것
    function eteherToTokenOutput(uint tokenAmount, uint maxEhterAmount) public payable {
        uint etherAmount = tokenAmount / 997 * 1000;
        require(maxEhterAmount >= etherAmount);
        require(msg.value >= etherAmount);
        uint etherRefundAmount = msg.value - etherAmount;

        if(etherRefundAmount > 0) {
            payable(msg.sender).transfer(etherRefundAmount);
        }

        ERC20 token = ERC20(tokenAddress);
        token.transfer(msg.sender, tokenAmount);
    }



    // 사용자가 이더 -> 토큰으로 바꿈
    function etherToTokenSwap() public payable {
        uint etherAmount = msg.value;
        uint tokenAmount = etherAmount;
        // 1 : 1 비율로 고정
        TokenA tokenContract = TokenA(tokenAddress); // TokenA 컨트랙트 인스턴스 생성
        tokenContract.transfer(msg.sender, tokenAmount); // TokenA의 trasnfer 생성
        // trasfer
        // balances[Exchange CA] -= tokenAmount;
        // balances[msg.sender(EOA)] += tokenAmount;
    }

    // 사용자가 토큰 -> 이더로 바꿈
    function tokenToEtherSwap(uint tokenAmount) public{
        TokenA tokenContract = TokenA(tokenAddress);
        tokenContract.transferFrom(msg.sender, address(this), tokenAmount);
        //transferFrom
        // balances[Exchange CA] += tokenAmount;
        // balances[msg.sender(EOA)] -= tokenAmount;
        // allowances[msg.sender(EOA)][Exchange CA] -= amount;
        uint etherAmount = tokenAmount;
        payable(msg.sender).transfer(etherAmount);
    }
}

